INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3001, 100, "ヤマト", 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2, 2.1, "2024/10/31 12:00:00", 130011, "2030/01/01 14:59:59", 1, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3001, 101, "ヤマト", 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 2, 5.68, "2024/10/31 12:00:00", 130011, "2030/01/01 14:59:59", 4, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3001, 102, "ヤマト", 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 0.0, "2024/10/31 12:00:00", 130011, "2030/01/01 14:59:59", 1, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3002, 100, "フブキ", 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 1, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3002, 101, "フブキ", 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 1, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3002, 102, "フブキ", 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 2, 8.53, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 5, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3002, 103, "フブキ", 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 1, 5.67, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 7, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3002, 104, "フブキ", 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 1, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3004, 300, "フブキ", 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 3, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3005, 301, "フブキ", 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 7, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3003, 200, "フブキ", 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 1, 4.4, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 2, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3003, 201, "フブキ", 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 0.0, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 7, -416.5, 0.0);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (3003, 202, "フブキ", 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 2, 5.6, "2024/10/31 12:00:00", 130211, "2030/01/01 14:59:59", 1, -416.5, 0.0);
